let rec process_generic_list_tail name a f  =
  match a with
  | [] -> Ad_empty_list name
  | a :: t ->
      let v1 = f a in
      if t != [] then Ad_process_list_tail ( v1 , process_generic_list_tail name t f)
      else v1

and quot a b =  Ad_quote( a,b)
    
and process_attribute_list a = quot_list "attribute" process_attribute a
and quot_list n fn ls =
  let quot_a c = quot n  (fn c) in
  process_generic_list     ("quot_list" ^ n)    ls    quot_a
    
and process_string a = quot "process_string"  a
and process_attribute a = quot "process_attribute"  a


and process_generic_list name a f  =
  Ad_process_generic_list( name,  [
    (match a with
    | [] -> Ad_empty_list name
    | a :: t ->
        let v1 = f a in
        if t != [] then Ad_process_list_tail (v1 , process_generic_list_tail name t f )
        else v1)
   ])

and def_basic (a : string)(b:string) =
  let t = "Definition " ^ a ^ "(T : "^ b ^ "): UU := umcr_refl. " in
  (print_endline t);
  t

and def_pair (a : string)(b:string)(a1:string)(b1:string) =
  let tt = "Definition " ^ a ^ "(T : "^ b^ "): UU := " ^ a1
           ^ " T Ã—u " ^  b1
           ^ " T."  in 
  ( print_endline tt);
  tt

and process_generic_type (a : string) (b : string) (c : ast_desc list) =
  let baset = "umcr_type" in
  let at = "umcr_n_role_" ^ a in
  let bt = "umcr_n_type_" ^ b in  
  let ct = "umcr_r_rel_" ^ a ^ "__"^ b in
  let f1 = (def_basic at baset) in 
  let f2 = (def_basic bt baset) in 
  let f3 = (def_pair ct baset at bt ) in
  Ad_root {
    sa_role =a;
    sa_type =b;
    sa_list =c;
  }

